import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter, Route} from 'react-router-dom';
import NavBar from './component/NavBar';

const navbar = (props) =>{
	console.log(props);
	return <NavBar/>
}

ReactDOM.render(
	<BrowserRouter>
		<div>
			<Route component={App}/>
			<Route path='/NavBar' component={navbar}/>
		</div>
	</BrowserRouter>,
	document.getElementById('root')
);
